module decrypt ( clk, n_rst, data, round_key, last_round, decrypted );
  input [127:0] data;
  input [127:0] round_key;
  output [127:0] decrypted;
  input clk, n_rst, last_round;
  wire   n2;
  wire   [127:0] sub_in;
  tri   [127:0] round_key;
  tri   [127:0] sub_out;
  tri   [127:0] mix_in;

  InvShiftRows Invshift_block ( .in(data), .out(sub_in) );
  InvSubstitute Invsub_block ( .data_in(sub_in), .data_out(sub_out) );
  addKey Invadd_block ( .in1(sub_out), .in2(round_key), .out(mix_in) );
  InvMixColumns Invmix_block ( .clk(clk), .n_rst(n_rst), .enable(n2), 
        .data_in(mix_in), .data_out(decrypted) );
  INVX1 U2 ( .A(last_round), .Y(n2) );
endmodule

